※北海道・沖縄・離島は送料が発生(税込7560円)しますので、ご注文後に送料・ご請求金額のご案内をさせていただきます。<br /> 
<br />
NV350キャラバン専用!<br />
<br />
<br />
<br />
<strong>【シーンに合わせて】</strong><br />
現場仕事に大活躍！<br />
さまざまなシチュエーションで活用できるルーフキャリアはワークシーンでも大活躍！重たい材料や鉄筋などもお任せ！<br />
<img src="http://image.rakuten.co.jp/ken-tool/cabinet/imgrc0065777187.jpg" width="500"><br />
<br />
<strong>【製品情報】</strong><br />
<strong>●強度</strong><br />
ルーフキャリアは、フレーム1本あたりなんと最大100kg/1本まで対応できます。長物重量物を車の上に載せる時、フレームが曲がってしまい大切な愛車に傷が付いてしまうと不安に感じた方も多いのでは。<br />
そんなあなたの不安をこのルーフキャリアが解消します。<br />
ぜひ強度抜群ルーフキャリアをお試し下さい！！<br />
<img src="http://image.rakuten.co.jp/ken-tool/cabinet/imgrc0065777188.gif" width="500">
<br style="clear:both;" />
<br />
<br />
<strong>●耐久性</strong><br />
<img style="float:left; margin-right:20px;" src="http://image.rakuten.co.jp/ken-tool/cabinet/imgrc0065777189.jpg">
耐久性抜群のアルミとステンレスを使い、横枠・荷台ともに統一感を出し、高級感が演出されています。 雨や雪にも強く、サビや変色にも強いので長い間お使いいただけます。<br />
<br style="clear:both;" />
<br />
<strong>●アルミ仕様</strong><br />
<img style="float:left; margin-right:20px;" src="http://image.rakuten.co.jp/ken-tool/cabinet/imgrc0065777190.jpg">
長年にわたりアルミを取り扱い、数多くの現場も施工してきた実績のある、丈夫で長持ちのアルミルーフキャリアです。<br />
<br style="clear:both;" />
<br />
<br />
<strong>【仕様】</strong><br />
車種・・・NV350キャラバン用<br />
品番・・・HRS-NV<br />
長さ外寸(mm)・・・3,500<br />
有効長(mm)・・・3,410<br />
幅内寸(mm)・・・1,470<br />
車高アップ(mm)・・・150
<br />
<br />
※ルーフキャリアのみの販売になります。車はつきません。<br />
